import { useAuth } from "../../hooks/useAuth";

const Home = () => {
  const { user } = useAuth();
  return (
    <div>
      <h1>Home Page</h1>
      <h2>{user ? `Welcome ${user.name}` : ""}</h2>
    </div>
  );
};

export default Home;
